import styled from "styled-components";

export const Foot = styled.footer`
  background-color: var(--myDark-color);
  display: flex;
  align-items: center;
  color: var(--white-color);
  text-align: center;
  justify-content: center;
  padding: 40px 0;
  & a {
    color: var(--white-color);
  }
`;
